import React from 'react'
import Home from './Home';
import Delicious from './Delicious';
import {
  Route,
  Routes,
} from "react-router-dom";

function Pages() {
  return (
    <div>
        <Router>
          <Routes>
            
            <Route path="/" element={<Home/>} />
            <Route path='/about' element={<Delicious/>}/>
            
          </Routes>
        </Router>
    </div>
  )
}

export default Pages
